INSERT INTO `table_about` (`id`, `ten`, `tenkhongdau`, `mota`, `noidung`, `photo`, `thumb`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `title`, `description`, `keywords`, `type`, `tenen`, `motaen`, `noidungen`) VALUES
(1, '', '', '<p style="text-align: justify;">Tọa lạc ngay tại trung tâm thành phố, trên con đường rợp bóng cây xanh mát của khu vực quận 3 đông đúc, náo nhiệt, <strong>KHÁNH GIA APARTMENT</strong> mang dáng vẻ sang trọng nhưng vô cùng thoáng đãng, với tòa nhà 7 tầng cùng khoảng sân rộng rãi. Khác với dịch vụ khách sạn, dịch vụ căn hộ Khánh Gia mang đến cho khách hàng sự thân thiện và an toàn như chính ngôi nhà của quý khách.</p>\r\n\r\n<p>Đúng với tên gọi Apartment - Căn hộ tiện ích mang dáng dấp của những chung cư cao cấp, đội ngũ bảo vệ 24/24 và các thiết bị hiện đại trong căn hộ,<strong> KHÁNH GIA APARTMENT</strong> khiến cho khách hàng dù cư trú ngắn hạn hay dài hạn đều cảm thấy thân thuộc và yên tâm.</p>\r\n', '<h3 style="text-align: center;"><span style="color:#FFFFFF;">    </span></h3>\r\n\r\n<h2 style="font-style: italic; text-align: center;"><span style="color:#FFFFFF;"><span style="font-size:36px;"><strong>HTL Tattoo Supply</strong></span></span></h2>\r\n\r\n<p style="text-align: center;"><span style="color:#FFFFFF;"><span style="font-size:20px;">Được thành lập từ 2011 với khởi đầu trong ngành xăm hình nghệ thuật. Artist Lợi chuyên về thể loại xăm chữ Hoa nét cọ, nay tìm hiểu sang lĩnh vực cung cấp dụng cụ xăm cho giới xăm hình chuyên nghiệp ở Việt Nam. Tìm tòi và học hỏi ở các nước bạn, nay chúng tôi nghiên cứu sản phẩm mới, chúng tôi hiểu rõ công dụng của từng sản phẩm và hiểu được những người thợ xăm họ cần điều gì là tốt nhất cho công việc của họ.</span></span></p>\r\n\r\n<p style="text-align: center;"><span style="color:#FFFFFF;"><span style="font-size:20px;">Số lượng : Với trên 4000 sản phẩm với nhiều mẫu mã khác nhau, tất cả cùng tạo nên một thương hiệu tốt nhất với giá thành hợp túi tiền và yêu cầu tiêu chuẩn của khách hàng. Phân phối trên toàn quốc.</span></span></p>\r\n\r\n<p style="text-align: center;"><span style="color:#FFFFFF;"><span style="font-size:20px;">Chế độ : Mọi sản phẩm sẽ được bảo hành 1 năm do lỗi của nhà sản xuất. HTL Tattoo Supply không nhận bảo hành với những sản phẩm do hư hại cá nhân.</span></span></p>\r\n\r\n<p style="text-align: center;"><span style="color:#FFFFFF;"><span style="font-size:20px;">Là nhà phân phối, đại lí kim EZ Needle Cartridges . Nhập khẩu từ nước ngoài [ USA, CHINA ]</span></span></p>\r\n', 'bg12344-9705.png', '', 1, 1, 1432957701, 1694136734, '', '', 'căn hộ dịch vụ, căn hộ dịch vụ quận 1, căn hộ dịch vụ giá rẻ, căn hộ cho thuê, phòng cho thuê, phòng cho thuê quận 1, phòng trọ quận 1, phòng cho thuê Q3, căn hộ dịch vụ, căn hộ dịch vụ quận 3, căn hộ', 'about', '', '<p>Joo House offers you a great living space. Joo House currently offers apartment and hotel rental services in prime locations in the heart of the city. We have more than 4 serviced apartment chains and this number is still growing strongly. You are free to create your own space, according to your own inspiration and style. We are happy when you are yourself.</p>\r\n', '<p>ok men</p>\r\n'),
