(95, 0, 0, 0, 1, 'n1-8030.jpg', 'n13850_535x310.jpg', '', 'DÙNG THẺ TÍN DỤNG HIỆU QUẢ KHI DU LỊCH NƯỚC NGOÀI ', 'dung-the-tin-dung-hieu-qua-khi-du-lich-nuoc-ngoai', 'Theo nghiên cứu mới nhất của các tổ chức tài chính, người Việt có xu hướng sử dụng thẻ tín dụng khi đi nước ngoài bởi tính tiện lợi hơn nhiều ...', '', 83, 1, 1, 0, 1601283790, 1601604594, '', '', '', 0, ' EFFECTIVE USE OF CREDIT CARD WHEN Traveling abroad', '\r\nAccording to the latest research by financial institutions, Vietnamese people tend to use credit cards when traveling abroad because it is much more convenient ...', '', 'tintuc', ''),
(96, 0, 0, 0, 1, 'n1-9283.jpg', 'n12228_535x310.jpg', '', 'SP Travel ra mắt chương trình khuyến mại nổi bật dành cho vé máy bay tri ân khách hàng', 'sp-travel-ra-mat-chuong-trinh-khuyen-mai-noi-bat-danh-cho-ve-may-bay-tri-an-khach-hang', 'Mức giảm tương đương với 100.000 vnd, giá trên hệ thống là giá đã giảm vui  ...', '', 114, 1, 1, 0, 1601283821, 1601604573, '', '', '', 0, 'SP Travel launches outstanding promotions for airline tickets to thank customers', '\r\nThe discount is equivalent to 100,000 VND, the price on the system is a fun discount ...', '', 'tintuc', ''),
(97, 0, 0, 0, 1, 'n1-7676.jpg', 'n16129_535x310.jpg', '', 'Đà Nẵng ra mắt cổng thông tin du lịch phục vụ du khách', 'da-nang-ra-mat-cong-thong-tin-du-lich-phuc-vu-du-khach', 'Với thông tin website này, người dân và khách du lịch có thể truy cập để tìm hiểu các thông tin tổng quan về thành phố...', '', 116, 1, 1, 0, 1601283841, 1601604518, '', '', '', 0, ' Da Nang launches a tourist portal to serve tourists', 'With this website information, residents and tourists can visit to learn general information about the city ...', '', 'tintuc', ''),
(98, 0, 0, 0, 1, 'n1-1685.jpg', 'n18684_535x310.jpg', '', 'Việt nam lọt top địa điểm du lịch', 'viet-nam-lot-top-dia-diem-du-lich', 'Theo khảo sát của Agoda, điểm đến được nhiều người tìm kiếm và muốn đến nhất năm 2020 là Đài Loan, Việt Nam đứng vị trí thứ 4.', '<h2 id="1-sapa---nhung-thua-ruong-bac-thang-ky-vi-nhat-the-gioi" style="box-sizing: border-box; font-family: montserrat, Arial, sans-serif; font-weight: 500; line-height: 1.1; color: rgb(51, 51, 51); margin-top: 20px; margin-bottom: 10px; font-size: 30px; -webkit-font-smoothing: antialiased; background-color: rgb(255, 255, 255); text-align: center;"><a href="https://nhandan.com.vn/dien-dan-dulich/du-lich-noi-dia-ghi-nhan-dau-hieu-tich-cuc-607914/">https://nhandan.com.vn/dien-dan-dulich/du-lich-noi-dia-ghi-nhan-dau-hieu-tich-cuc-607914/</a></h2>\r\n', 114, 1, 1, 0, 1601284616, 1603174867, '', '', '', 0, ' Vietnam is in the top of the dream destination', 'According to a survey of Agoda, the destination most searched and wanted by the year 2020 is Taiwan, Vietnam ranked 4th.', '', 'tintuc', ''),
(99, 0, 0, 0, 0, 'homepage-take-care-of-little-0251.jpg', 'homepage-take-care-of-little7689_535x310.jpg', '', 'Chăm sóc từ điều nhỏ nhất', 'cham-soc-tu-dieu-nho-nhat', 'Hà Giang là một địa danh có vẻ đẹp kỳ vĩ quen thuộc với nhiều người, du lịch Hà Giang đã được biết đến, tuy nhiên để có một cái ...', '', 78, 1, 1, 0, 1601343754, 1694160415, '', '', '', 0, 'Take care of the smallest things', 'Ha Giang is a place with magnificent beauty familiar to many people, Ha Giang tourism has been known, but to have one ...', '', 'camnangdulich', ''),
