INSERT INTO `table_product` (`id`, `id_list`, `id_item`, `id_cat`, `id_loaicanho`, `id_loaitienich`, `noibat`, `photo`, `thumb`, `ten`, `tenkhongdau`, `mota`, `masp`, `gia`, `giangay`, `giacu`, `noidung`, `luotxem`, `stt`, `hienthi`, `spmoi`, `spbanchay`, `ngaytao`, `ngaysua`, `title`, `keywords`, `description`, `id_danhmuc`, `tieubieu`, `nhasanxuat`, `id_nhasanxuat`, `tenen`, `motaen`, `noidungen`, `type`, `size`, `mausac`, `tag`, `soluong`, `dientich`, `sophongngu`, `diachi`, `map`, `id_tientich`, `soldout`, `tenchunha`, `sdtchunha`, `phuong`, `quan`, `namtrenduong`, `sonha`, `giadien`, `gianuoc`, `phidichvu`, `phiguixe`, `phihoahongchutro`, `linkvideo`, `nhomkhohang`, `sophong`, `lau`) VALUES
(197, 70, 0, 0, 57, '49,60,61,50,53,59,47,52,48', 0, 'z2508569670589_9f8c25e0ac263773f120aafb5621b409-4795.jpg', 'z2508569670589_9f8c25e0ac263773f120aafb5621b4093373_510x307.jpg', 'Căn hộ Studio/Ban công - R2.1 - JHLux  (Còn 01 phòng)', 'can-ho-studioban-cong-r21-jhlux-con-01-phong', '<ul>\r\n	<li>\r\n	<h2><strong>Joo House Lux </strong></h2>\r\n	</li>\r\n</ul>\r\n\r\n<p>Diên tích 42m2<br />\r\nFull option<br />\r\nCó Thang máy<br />\r\nCó bếp<br />\r\nCó ban công<br />\r\nTiền điện 4.000/kw <br />\r\nGiữ xe 180k/tháng</p>\r\n\r\n<p>Dọn phòng 3lần/tuần _ free<br />\r\nMáy giặt/sấy chung _ free<br />\r\nInternet _ free<br />\r\nTiền nước _ free<br />\r\nỞ tối đa 2 khách<br />\r\nVới khách cọc đủ thì giữ phòng được 10ngày <br />\r\nCọc 1 tháng/ trả 1 tháng</p>\r\n', '', 10.5, '700', 0, '<p>❄️❄️❄️<strong>TUYỆT TÁC</strong>❄️❄️❄️</p>\r\n\r\n<p><strong>Căn hộ dịch vụ cho thuê JooHouse LUX</strong></p>\r\n\r\n<p>Căn hộ Studio bán đảo Thanh Đa.<br />\r\n- Diện tích từ 35m2<br />\r\n- Căn hộ full nội thất cao cấp theo phong cách Retro châu Âu bán cổ điển.<br />\r\n- Không gian thoáng mát, nhiều nắng-gió và cây xanh.<br />\r\n❄️ <strong>Vị trí: </strong><br />\r\n- Cửa ngõ bán đảo Thanh Đa(ngay chân cầu Kinh) phường 27, quận Bình Thạnh<br />\r\n- Thuận tiện di chuyển đi các quận 1, 2, 3, Thủ Đức, Gò Vấp, Phú Nhuận...<br />\r\n- Cách bến xe bus trên sông 200m (rất thuận tiện di chuyển vào bến Bạch Đằng Q1) và đi du lịch đường thuỷ quanh Sài Gòn.<br />\r\n- Cách chợ Thanh Đa 200m<br />\r\n- Xung quanh có rất nhiều của hàng tiện ích, nhà hàng ăn uống, khu du lịch Bình Quới...</p>\r\n\r\n<p>❄️ <strong>Tiện ích toà nhà:</strong><br />\r\n- Sảnh đón rộng, nhiều không gian tiếp khách ngoài phòng.<br />\r\n- Thang máy 6 lầu<br />\r\n- Dọn phòng 3 lần/tuần (miễn phí)<br />\r\n- Máy giặt sấy hiện đại <br />\r\n- Khách tự giặt hoặc sử dụng dịch vụ 200k/người/tháng)<br />\r\n- Sân thượng rộng(có thể tổ chức party nhỏ)<br />\r\n- Không gian thoáng mát, nhiều cây xanh trong nhà.<br />\r\n- Các phòng bố trí lệch tầng tạo sự riêng tư cho mỗi phòng.</p>\r\n\r\n<p>❄️ <strong>Nội thất phòng:</strong><br />\r\n- Ban công rộng, nhiều cây xanh<br />\r\n- Tủ quần áo rộng<br />\r\n- Máy lạnh Daikin(tiết kiệm điện)<br />\r\n- Bàn ủi<br />\r\n- Điện 4.000/kw<br />\r\n- Internet TV Samsung 49 inchs<br />\r\n- Internet tốc độ cao 100Mb/s<br />\r\n- Bàn ăn thông minh<br />\r\n- Tủ lạnh lớn 2 buồng 150ml<br />\r\n- Bếp đầy đủ đồ nấu<br />\r\n- Lò vi sóng<br />\r\n- Phòng tắm vách kính sang trọng</p>\r\n', 525, 197, 1, 0, 0, 1601259143, 1692950702, '', '', '', 70, 0, '', 0, 'Joo house - Thanh Da', '<p>Perfect location + Comfortable space + Friendly staff<br />\r\n- Our goal is to provide you with a great experience during your stay. The apartment is located in the heart of Saigon with full amenities and amenities. District 3 has many peaceful streets that you can just walk to find restaurants, cafes or tourist attractions.<br />\r\n- Outstanding apartment with tropical style in urban area. The bed is completely comfortable to sleep! Plus, thanks to the kitchen, you can cook.</p>\r\n', '<p style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; background-color: rgb(255, 255, 255);"><span style="font-size:20px;"><b>SPACE</b></span></p>\r\n\r\n<p style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="font-size:14px;">The apartment is designed and decorated in a modern style to create a comfortable space for guests. It welcomes a lot of natural light & cool atmosphere. Full kitchen, private bathroom and especially a working corner!</span></p>\r\n\r\n<p style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"> </p>\r\n\r\n<p style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="font-size:16px;"><strong style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;">COMFORTABLE SPACE:</strong></span></p>\r\n\r\n<p style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="font-size:14px;">+ Soft bed - spring mattress - many guests like<br />\r\n+ Private bathroom (bathtub + hot and cold shower)<br />\r\n+ Fully equipped kitchen (refrigerator, microwave, kettle, magnetic stove)<br />\r\n+ Air conditioner, furniture, fast WiFi, cable TV.<br />\r\n+ FREE motorbike parking (quantity is limited, so please confirm with us if you have one)<br />\r\n+ Paid car parking is nearby.<br />\r\n+ Free cleaning service 3 times / week.</span></p>\r\n\r\n<p style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"> </p>\r\n\r\n<p style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="font-size:16px;"><b>EXCELLENT LOCATION:</b></span></p>\r\n\r\n<p style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 13px; background-color: rgb(255, 255, 255);"><span style="font-size:14px;">Easy to visit tourist destinations in 5-15 minutes such as Ben Thanh Market, Bitexco, Notre Dame Cathedral, Saigon Post Office, War Remnants Museum ... Next to delicious restaurants, cafes, fashion shops pages, markets ...</span></p>\r\n\r\n<p style="margin: 0px; paddin