(202, 28, 0, 4, 44, '49,60,72,70,51,73,61,59,53,66,47,52,48,68', 0, '3-7600.jpg', '32128_510x307.jpg', 'Căn hộ 1 phòng ngủ / Mã căn: JH4-22 ', 'can-ho-1-phong-ngu-ma-can-jh422', '<h3><strong>Joohouse Apartment</strong><br />\r\n </h3>\r\n\r\n<ul>\r\n	<li> Diên tích 45m2</li>\r\n	<li> Thang máy</li>\r\n	<li> Bếp từ đôi</li>\r\n	<li> Nhà để xe </li>\r\n	<li> Tiền điện 4.000/kw </li>\r\n	<li>Tiền nước 150k/người</li>\r\n	<li> Dọn phòng 2lần/tuần _ free</li>\r\n	<li> Máy giặt chung _ free</li>\r\n	<li> Internet _ free</li>\r\n	<li> Tiền nước _ free</li>\r\n	<li> Phòng có thú cưng nhỏ<5kg</li>\r\n	<li> Ở tối đa 2 khách </li>\r\n	<li> Cọc 1 tháng/ trả 1 tháng</li>\r\n</ul>\r\n', '', 14, '750', 0, '<p>CHDV 1 phòng ngủ mới toanh ngay trung tâm quận 1.<br />\r\nMỗi căn hộ rộng 45m2. </p>\r\n\r\n<ul>\r\n	<li><strong>PHÒNG NGỦ</strong></li>\r\n</ul>\r\n\r\n<p>Cửa sổ lớn mở toang thông thoáng đón toàn bộ nắng và gió. <br />\r\nTủ quần áo 3 buồng cùng các kệ tủ bố trí khoa học với nhiều ngăn chứa đồ.<br />\r\nBàn làm việc/bàn phấn được đặt ở vị trí lí tưởng với nhiều ánh sáng.<br />\r\nVách kính tấm lớn ngăn cách phòng ngủ và không gian p.khách/bếp làm cho căn hộ có một tầm nhìn mở và cảm giác rộng hơn với diện tích thực. </p>\r\n\r\n<ul>\r\n	<li><strong>PHÒNG KHÁCH</strong></li>\r\n</ul>\r\n\r\n<p>Phòng khách với sofa da cao cấp kèm bàn thông minh tiện dụng.<br />\r\nAndroid TV 45inchs hiện đại mới khui thùng. Sẵn sàng với các ứng dụng mới nhất: Netflix/Youtube/Fpt play/VTV go...</p>\r\n\r\n<ul>\r\n	<li><strong>NHÀ BẾP</strong></li>\r\n</ul>\r\n\r\n<p>Bếp hình chữ L 2 tầng với nhiều ngăn để đồ<br />\r\n2 khoang bếp từ âm / máy hút mùi cao cấp<br />\r\nTủ lạnh Sanyo 270 lít<br />\r\nLò vi sóng và đầy đủ thiết bị đồ dùng nhà bếp.</p>\r\n\r\n<ul>\r\n	<li><strong>PHÒNG TẮM</strong></li>\r\n</ul>\r\n\r\n<p>Phòng tắm vách kính<br />\r\nBàn bồn rửa rộng rãi <br />\r\nToàn bộ trang thiết bị vệ sinh phòng tắm thương hiệu Inax cao cấp.</p>\r\n\r\n<ul>\r\n	<li><strong>TỦ ĐA NĂNG</strong></li>\r\n</ul>\r\n\r\n<p>Tủ để giày 2 tầng cùng nhiều ngăn chứa đồ.<br />\r\nToàn bộ đồ gỗ nội thất được sử dụng chất liệu cao cấp của An Cường. </p>\r\n\r\n<ul>\r\n	<li><strong>GIẶT/SẤY</strong></li>\r\n</ul>\r\n\r\n<p>Máy giặt/sấy lồng ngang Electrolux hiện đại được bố trí trên tầng cao tại khu vực riêng biệt. Bạn có thể tự giặt hoặc sử dụng dịch vụ giặt sấy của chúng tôi.</p>\r\n\r\n<ul>\r\n	<li><strong>KHÔNG GIAN CHUNG</strong></li>\r\n</ul>\r\n\r\n<p>Quầy lễ tân và bàn tiếp khách lịch sự tại sảnh đón.<br />\r\nSân thượng "chill chill" rộng rãi, thoáng mát...không gian lí tưởng để thư giãn vào những đêm trăng thanh gió mát :))</p>\r\n', 145, 202, 1, 0, 0, 1614158885, 1693025989, 'Căn hộ Joo House 4- JH 202', 'căn hộ dịch vụ quận 1, căn hộ dịch vụ 1 phòng ngủ, căn hộ cao cấp quận 1', '', 65, 0, '', 0, '', '', '', 'sanpham', '', '', '', 0, 45, 0, 'Trần Đình Xu, phường Cầu Kho, Quận 1', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3919.6575063016044!2d106.68853191451197!3d10.760857062424055!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x31752f10e42215b7%3A0xb58e5a1fe0f4be49!2zNTUvMyBUcuG6p24gxJDDrG5oIFh1LCBD4bqndSBLaG8sIFF14bqtbiAxLCBUaMOgbmggcGjhu5EgSOG7kyBDaMOtIE1pbmgsIFZp4buHdCBOYW0!5e0!3m2!1svi!2s!4v1614164296002!5m2!1svi!2s" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy"></iframe>', '', 0, 'Trung', '0912345579', '', '', '', '55/3A ', '4', '150', '0', '0', '', '', 'JOOHOUSE', '202', '2'),
(203, 70, 0, 0, 57, '49,60,61,50,53,59,47,52,48', 0, 'z2348684132878_33299a0292ebce3530477058799cbe0b-5344.jpg', 'z2348684132878_33299a0292ebce3530477058799cbe0b4210_510x307.jpg', 'CĂn hộ Studio/Ban công - R3.2 - JHLux', 'can-ho-studioban-cong-r32-jhlux', '<ul>\r\n	<li>\r\n	<h2><strong>Joo House Lux </strong></h2>\r\n	</li>\r\n</ul>\r\n\r\n<p>Diên tích 35m2<br />\r\nFull option<br />\r\nCó Thang máy<br />\r\nCó bếp<br />\r\nCó ban công<br />\r\nTiền điện 4.000/kw <br />\r\nGiữ xe 180k/tháng</p>\r\n\r\n<p>Dọn phòng 3lần/tuần _ free<br />\r\nMáy giặt/sấy chung _ free<br />\r\nInternet _ free<br />\r\nTiền nước _ free<br />\r\nỞ tối đa 2 khách<br />\r\nVới khách cọc đủ thì giữ phòng được 10ngày <br />\r\nCọc 1 tháng/ trả 1 tháng</p>\r\n', '', 9.5, '650', 0, '<p>❄️❄️❄️<strong>TUYỆT TÁC</strong>❄️❄️❄️</p>\r\n\r\n<p><strong>Căn hộ dịch vụ cho thuê JooHouse LUX</strong></p>\r\n\r\n<p>Căn hộ Studio bán đảo Thanh Đa.<br />\r\n- Diện tích từ 35m2<br />\r\n- Căn hộ full nội thất cao cấp theo phong cách Retro châu Âu bán cổ điển.<br />\r\n- Không gian thoáng mát, nhiều nắng-gió và cây xanh.<br />\r\n❄️ <strong>Vị trí: </strong><br />\r\n- Cửa ngõ bán đảo Thanh Đa(ngay chân cầu Kinh) phường 27, quận Bình Thạnh<br />\r\n- Thuận tiện di chuyển đi các quận 1, 2, 3, Thủ Đức, Gò Vấp, Phú Nhuận...<br />\r\n- Cách bến xe bus trên sông 200m (rất thuận tiện di chuyển vào bến Bạch Đằng Q1) và đi du lịch đường thuỷ quanh Sài Gòn.<br />\r\n- Cách chợ Thanh Đa 200m<br />\r\n- Xung quanh có rất nhiều của hàng tiện ích, nhà hàng ăn uống, khu du lịch Bình Quới...</p>\r\n\r\n<p>❄️ <strong>Tiện ích toà nhà:</strong><br />\r\n- Sảnh đón rộng, nhiều không gian tiếp khách ngoài phòng.<br />\r\n- Thang máy 6 lầu<br />\r\n- Dọn phòng 3 lần/tuần (miễn phí)<br />\r\n- Máy giặt sấy hiện đại <br />\r\n- Khách tự giặt hoặc sử dụng dịch vụ 200k/người/tháng)<br />\r\n- Sân thượng rộng(có thể tổ chức party nhỏ)<br />\r\n- Không gian thoáng mát, nhiều cây xanh trong nhà.<br />\r\n- Các phòng bố trí lệch tầng tạo sự riêng tư cho mỗi phòng.</p>\r\n\r\n<p>❄️ <strong>Nội thất phòng:</strong><br />\r\n- Ban công rộng, nhiều cây xanh<br />\r\n- Tủ quần áo rộng<br />\r\n- Máy lạnh Daikin(tiết kiệm điện)<br />\r\n- Bàn ủi<br />\r\n- Điện 4.000/kw<br />\r\n- Internet TV Samsung 49 inchs<br />\r\n- Internet tốc độ cao 100Mb/s<br />\r\n- Bàn ăn thông minh<br />\r\n- Tủ lạnh lớn 2 buồng 150ml<br />\r\n- Bếp đầy đủ đồ nấu<br />\r\n- Lò vi sóng<br />\r\n- Phòng tắm vách kính sang trọng</p>\r\n', 332, 203, 1, 0, 0, 1614244778, 1692950574, 'Căn hộ Studio', 'căn hộ dịch vụ, căn hộ dịch vụ quận Bình Thạnh, căn hộ dịch vụ giá rẻ, căn hộ cho thuê, phòng cho thuê, phòng cho thuê quận Bình Thạnh, phòng trọ quận Bình Thạnh, phòng cho thuê Bình Thạnh', '', 70, 0, '', 0, '', '', '', 'sanpham', '', '', '', 0, 35, 0, 'Tòa nhà Joo House Lux, số 17/7 Thanh Đa, phường 27, Bình Thạnh', '<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3918.927309128488!2d106.71660291428728!3d10.816874861404836!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3175292cab3ae3d7%3A0xd60b35d7bbef347c!2sJoo%20House%20Lux%20Apartment!5e0!3m2!1svi!2s!4v1621776994029!5m2!1svi!2s" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy"></iframe>', '', 0, ' Hữu - Huyền ', 'Ngọc Hữu - Huyền Cara House', '', '', '', 'R3.2', '4', '100', '200k/tháng   ', '180', '40-80', '', '17/7 Thanh Đa', NULL, NULL),
