(209, 28, 0, 4, 43, '49,60,51,61,59,50,53,47,46,52,48', 0, 'z2508616389194_7c49c186adea7e30f0e4f523096cad6c-5757.jpg', 'z2508616389194_7c49c186adea7e30f0e4f523096cad6c4091_510x307.jpg', 'Căn hộ Duplex 2 phòng ngủ/Ban công Mã căn: JH3-62', 'can-ho-duplex-2-phong-nguban-cong-ma-can-jh362', '<ul>\r\n	<li><strong>Căn hộ Duplex 65m2 có ban công</strong></li>\r\n</ul>\r\n\r\n<p>Căn hộ Duplex 2 phòng ngủ</p>\r\n\r\n<p>2 máy lạnh</p>\r\n\r\n<p>Lầu cao nhất tòa nhà</p>\r\n\r\n<p>Thang máy</p>\r\n\r\n<p>Thẻ từ</p>\r\n\r\n<p>Giờ tự do</p>\r\n\r\n<p>Điện 4.000₫/kw<br />\r\nDọn phòng 3 lần/tuần<br />\r\nNước uống 2 bình/ tháng<br />\r\nMáy giặt/sấy free<br />\r\nĐầy đủ nội thất</p>\r\n\r\n<p>Có ban công<br />\r\nKhu vực nhiều tiện ích, siêu thị, trung tâm thương mại.</p>\r\n\r\n<p> </p>\r\n', '', 16, '900', 0, '<p><strong>CHDV Duplex 02 phòng ngủ </strong></p>\r\n\r\n<p><b>D</b>iện tích 60m2. </p>\r\n\r\n<ul>\r\n	<li><strong>PHÒNG NGỦ</strong></li>\r\n</ul>\r\n\r\n<p>Phòng ngủ chính với cửa sổ lớn mở toang thông thoáng đón toàn bộ nắng và gió. <br />\r\nTủ quần áo 3 buồng cùng các kệ tủ bố trí khoa học với nhiều ngăn chứa đồ.</p>\r\n\r\n<p>Phòng ngủ thứ 2 nằm trên gác, có bàn làm việc bên cạnh cửa sổ lớn có view cực thoáng</p>\r\n\r\n<p>Bàn làm việc/bàn phấn được đặt ở vị trí lí tưởng với nhiều ánh sáng.<br />\r\nVách kính tấm lớn ngăn cách phòng ngủ và không gian p.khách/bếp làm cho căn hộ có một tầm nhìn mở và cảm giác rộng hơn với diện tích thực. </p>\r\n\r\n<ul>\r\n	<li><strong>PHÒNG KHÁCH</strong></li>\r\n</ul>\r\n\r\n<p>Phòng khách với sofa da cao cấp kèm bàn thông minh tiện dụng.<br />\r\nAndroid TV 45inchs hiện đại mới khui thùng. Sẵn sàng với các ứng dụng mới nhất: Netflix/Youtube/Fpt play/VTV go...</p>\r\n\r\n<ul>\r\n	<li><strong> NHÀ BẾP</strong></li>\r\n</ul>\r\n\r\n<p>Bếp lớn 2 tầng với nhiều ngăn để đồ<br />\r\n2 khoang bếp từ âm / máy hút mùi cao cấp<br />\r\nTủ lạnh cỡ đại 470 lít<br />\r\nLò vi sóng và đầy đủ thiết bị đồ dùng nhà bếp.</p>\r\n', 127, 209, 1, 0, 0