e; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);">\r\n	<li style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;"><strong style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;">PHÒNG NGỦ</strong></li>\r\n</ul>\r\n\r\n<p style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);">Cửa sổ lớn mở toang thông thoáng đón toàn bộ nắng và gió. <br style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;" />\r\nTủ quần áo 3 buồng cùng các kệ tủ bố trí khoa học với nhiều ngăn chứa đồ.<br style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;" />\r\nBàn làm việc/bàn phấn được đặt ở vị trí lí tưởng với nhiều ánh sáng.<br style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;" />\r\nVách kính tấm lớn ngăn cách phòng ngủ và không gian p.khách/bếp làm cho căn hộ có một tầm nhìn mở và cảm giác rộng hơn với diện tích thực. </p>\r\n\r\n<p style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);"> </p>\r\n\r\n<ul style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);">\r\n	<li style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;"><strong style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;">PHÒNG KHÁCH</strong></li>\r\n</ul>\r\n\r\n<p style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);">Phòng khách với sofa da cao cấp kèm bàn thông minh tiện dụng.<br style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;" />\r\nAndroid TV 45inchs hiện đại mới khui thùng. Sẵn sàng với các ứng dụng mới nhất: Netflix/Youtube/Fpt play/VTV go...</p>\r\n\r\n<p style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);"> </p>\r\n\r\n<ul style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);">\r\n	<li style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;"><strong style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;">NHÀ BẾP</strong></li>\r\n</ul>\r\n\r\n<p style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);">Bếp hình chữ L 2 tầng với nhiều ngăn để đồ<br style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;" />\r\n2 khoang bếp từ âm / máy hút mùi cao cấp<br style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;" />\r\nTủ lạnh Sanyo 270 lít<br style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none;" />\r\nLò vi sóng và đầy đủ thiết bị đồ dùng nhà bếp.</p>\r\n\r\n<p style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 15px; background-color: rgb(255, 255, 255);"> </p>\r\n\r\n<ul style="margin: 0px; padding: 0px; list-style: none; box-sizing: border-box; outline: none; font-family: UTMAvo, Arial, sans-serif; font-size: 15px; background-col