(256, 0, 0, 0, 57, '49,60,51,61,50,53,59,47,52,48', 0, 'z4181156228171_39133ff02a003a87f3f0e0e22bff04f3-6166.jpg', 'z4181156228171_39133ff02a003a87f3f0e0e22bff04f36911_510x307.jpg', 'Căn hộ 1 phòng ngủ nội thất cao cấp - AH-PN08', 'can-ho-1-phong-ngu-noi-that-cao-cap-ahpn08', '', '', 12, '', 0, '<p>I. DỊCH VỤ - TIỆN ÍCH TÒA NHÀ<br />\r\n- Dịch vụ dọn phòng 3lần/tuần.<br />\r\n- Vệ sinh tòa nhà, hành lang mỗi ngày.<br />\r\n- Trang bị hệ thống wifi tốc độ cao.<br />\r\n- Máy giặt có chức năng sấy <br />\r\n- Sân thượng tòa nhà trang bị đầy đủ hệ thống bếp, đèn trang trí, lò nướng phục vụ nhu cầu BBQ, tổ chức tiệc nhóm bạn...<br />\r\n- Phí có 2 loại: Điện 4k & phí dv 200k/người. Các khoản còn lại free.</p>\r\n\r\n<p>II. QUY ĐỊNH TÒA NHÀ<br />\r\n- Số người ở: tối đa 2 người / phòng.<br />\r\n- Số xe: tối đa 2 xe.<br />\r\n- Giờ giấc tự do 24/7<br />\r\n- PET: Không nuôi pet.<br />\r\nPhòng trang bị full Nội thất </p>\r\n', 49, 103, 1, 0, 0, 1678949830, 1678950870, '', 'Căn hộ dịch vụ, Cho thuê căn hộ dịch vụ, Căn hộ dịch vụ cao cấp, Giá cho thuê căn hộ dịch vụ, Căn hộ dịch vụ quận 1, 2, 3,..., Dịch vụ căn hộ ngắn hạn, Căn hộ dịch vụ tiện nghi, Căn hộ dịch vụ sang trọng, Căn hộ dịch vụ cho gia đình, Căn hộ dịch vụ tại Tp. Hồ Chí Minh.', '', 58, 0, '', 0, '', '', '', 'sanpham', '', '', '', 0, 35, 1, '317 Phan Đình Phùng, phường 15, Phú Nhuận', 'https://goo.gl/maps/rrWTxm1Sbiakbxb57', '', 0, '', '', '', '', '', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
