(71, '', '24 Lê Thánh Tôn, Phường Bến Nghé, Quận 1, TP.HCM<br>\r\n0931 332 332', 'Quận Phú Nhuận', 'quan-phu-nhuan', 'rectangle-15-3646.png', 'rectangle-157017_365x220.png', 15, 1, 1692853652, 1694166375, 'Chi nhánh Phú Nhuận', 1, '', 'DIstrict Phu Nhuan', '', 'location', 'Giao lộ tinh hoa của kỳ quan Đông Dương. Một kỳ nghỉ duy mỹ tại khách sạn mang nét đẹp Đông Dương đương đại. Một địa điểm lý tưởng để chiêm ngưỡng tầm nhìn “triệu đô” nhìn ra những danh thắng nổi tiếng bậc nhất tại trung tâm Sài Gòn.', 'The art of Indochina wonders. A meticulous hospitality experience inside the contemporary Indochina architecture. A great location to enjoy the stunning view of the most famous landmarks in Sai Gon’s center.'),
(72, '', '74 Hai Bà Trưng, Phường Bến Nghé, Quận 1, TP. HCM<br>\r\n\r\n0931 332 332', 'Quận Tân Bình', 'quan-tan-binh', 'home-banner-desktop-2987.jpg', 'home-banner-desktop2623_365x220.jpg', 16, 1, 1692853674, 1694166364, 'Chi nhánh Tân Bình', 1, '', 'District Tan Binh', '', 'location', 'Giao điểm của văn hóa Á Đông - Sài Gòn. Một không gian hiện đại, tối giản và gần gũi với thiên nhiên cho trải nghiệm Workcation - Staycation. Một chốn lưu trú mang đến trải nghiệm đa văn hóa ngay giữa lòng phố Nhật.\r\n\r\n', 'Where the multi-culture meets. A modern space designed in a minimalist style, blending harmoniously with the nature amidst for Work-cation - Staycation. A place with a multicultural experience in the heart of “little Japan”.'),
